import React from 'react'
import {Column, Flex} from './layout'
import styled from 'styled-components'
import {fontSize} from 'styled-system'

const Option = styled.p`
  color: ${props => props.theme.colors.darkBlue};
  font-weight: 700;
  ${fontSize}
`

const Box = styled.div`
  background-color: white;
  box-shadow: 0 0 5px 0 #A2AEB7;
  border-radius: 2px;
  cursor: pointer;
  &:hover {
    background-color: ${props => props.theme.colors.green};
    ${Option} {
      color: white;
    }
  }
  &:active {
    transform: scale(0.99);
    box-shadow: none;
  }
`

const CheckList = ({items}) => <Flex justifyContent="center">
    {items.map(item => (
        <Box alignItems="center" justifyContent="center" m={10} height={140} width={140}>
            <Option fontSize={[12, 16]}>{item}</Option>
        </Box>
    ))}
</Flex>

export default CheckList
